import React, {useState, useEffect} from 'react';

import EmployeeService from '../services/EmployeeService';
import {useParams} from 'react-router-dom';
import { Link} from 'react-router-dom/cjs/react-router-dom.min';
import './Component.css';

const ViewEmployeeComponent = () => {

   
    const {id} = useParams();
       

    return (
        <div className = "container">
            <ul class="nav">
            <li class="nav-item">
                <Link class="nav-link active"  to={`/view-employee-personal/${id}`}>Personal</Link>
            </li>
            <li class="nav-item">
                <Link class="nav-link active"  to={`/view-employee-professional/${id}`}>Professional</Link>
            </li>
            <li class="nav-item">
                <Link class="nav-link active"  to={`/view-employee-finance/${id}`}>Finance</Link>
            </li>
            </ul>
        </div>
    )
}
export default ViewEmployeeComponent
